    <style>
    html, body, table {

        padding-left: 2px;

        padding: 10px;

        margin-left: -6px;
    }

        position: absolute;
        right: 40px;
        color:#ddd;
    }

    div.selected, div.normal {
        margin: 5px;

        background: #ddd;

            background: inherit;
        }

        margin-left: 15px;

    }

        td, th {
            white-space: nowrap;
        }
    }

    .caption {
        text-align: center;
        font-size: 90%;
    }

    img {
        display: block;
        margin: auto;
        max-height: 20cm;

    span.legend-square {
        width: 1em;
        height: 1em;
        margin-right: 6px;

    }

    span.legend-item {
        margin-right: 24px;

        border: 1px solid silver;
        font-style: italic;
        width: 100%;
        height: 4em;
    }

    .textwrapper {
        padding: 15px;
    }

    div.normal textarea:invalid {
        display: none;
    }

    div.selected textarea {
        display: block;
    }

    @media print{
        section.section, img {
            page-break-inside: avoid;
        }
    }

    <script>

        var sel_el = document.getElementsByClassName('selected')[0];

        }
        sel_el = document.getElementById(id);
        if (sel_el != undefined) {
            sel_el.className = 'selected';
            return true;
        }
        return false;
    };
